    return (
        <mesh>
            <boxGeometry args={[1.8,1.8,1.8]}/>
            <meshStandardMaterial>
                <color attach={"background"} args={"#e76666"}/>
                <Text fontSize>
                    hello
                </Text>
            </meshStandardMaterial>
        </mesh>
    )
}
